A curly hair styling routine that nobody asked for 🤣

If you are someone who has curly hair and is trying to style it curly, with only a few products ( and hence maintainable) then this one is definitely for you. It takes almost 10 minutes to do this ( based on the original record time 😉). Ignore my weird hand gestures, I get super awkward in front of my camera, but am working on pushing myself to get more comfortable. So let’s see how that goes. 

Products used:
@colorwowhair - Curl Shampoo and Conditioner 
@innersenseorganicbeauty - Quiet calm curl control cream and I create curl memory gel 
@shopverb - Ghost Oil 

I find this also easy to maintain, just refresh the hair with water using a hair sprayer, ever morning and my curls still hold their shape 😀 This is my longest video, let me know if you these kind of videos 😀 If you have any other curly hair products you love and you think are worth trying, share them in the comments 😃 Bye now! 

